import React, { Suspense,useEffect } from "react";
import Aos from "aos";
import { Routes, Route } from "react-router-dom";
import { LoopCircleLoading } from "react-loadingg";
const HomePage = React.lazy(() => import("./Pages/homePage/homePage"));
const Header = React.lazy(() => import("./Components/header/header"));
const BackgroundVideo = React.lazy(() => import("./Components/Background/Background"));
function App() {
  useEffect(() => {
    Aos.init({ duration: 2000 });
  }, []);
  return (
    <div >
      <meta name="viewport" content="width=device-width, initial-scale=1.0"></meta>
      <Suspense fallback={<LoopCircleLoading />}>
        <section>
        <BackgroundVideo/>
          <Header />
          <Routes>
            <Route exact path="/" element={<HomePage />}></Route>
            {/* <Route exact path="/edit-profile" element={<EditProfile />}></Route>
            <Route exact path="/home" element={<Body />}></Route>
            <Route exact path="/new-post" element={<NewPost />}></Route>
            <Route exact path="/nft-detail" element={<DetailsPage />}></Route> */}
          </Routes>
        </section>
      </Suspense>
    </div>
  );
}

export default App;
